import React, { useState } from 'react';
import { Link } from 'react-router-dom';

function PredictorForm() {
  const [flightNumber, setFlightNumber] = useState('');
  const [departureAirport, setDepartureAirport] = useState('');
  const [arrivalAirport, setArrivalAirport] = useState('');
  const [departureDate, setDepartureDate] = useState('');
  const [departureTime, setDepartureTime] = useState('');
  const [airline, setAirline] = useState('');
  const [weatherCondition, setWeatherCondition] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Add code to pass data to AI model here or to navigate to prediction page
  };

  return (
    <div className="container my-5">
      <div className="card shadow-sm">
        <div className="card-body">
          <h1 className="text-center mb-4">Flight Delay Prediction</h1>
          <p className="text-center">Enter your flight details to predict possible delays.</p>
          
          <form onSubmit={handleSubmit}>
            {/* Flight Number */}
            <div className="mb-3">
              <label className="form-label">Flight Number</label>
              <input
                type="text"
                className="form-control"
                placeholder="e.g., AA1234"
                value={flightNumber}
                onChange={(e) => setFlightNumber(e.target.value)}
              />
            </div>

            {/* Departure and Arrival Airports */}
            <div className="row mb-3">
              <div className="col-md-6">
                <label className="form-label">Departure Airport</label>
                <input
                  type="text"
                  className="form-control"
                  placeholder="e.g., JFK"
                  value={departureAirport}
                  onChange={(e) => setDepartureAirport(e.target.value)}
                />
              </div>
              <div className="col-md-6">
                <label className="form-label">Arrival Airport</label>
                <input
                  type="text"
                  className="form-control"
                  placeholder="e.g., LAX"
                  value={arrivalAirport}
                  onChange={(e) => setArrivalAirport(e.target.value)}
                />
              </div>
            </div>

            {/* Departure Date and Time */}
            <div className="row mb-3">
              <div className="col-md-6">
                <label className="form-label">Departure Date</label>
                <input
                  type="date"
                  className="form-control"
                  value={departureDate}
                  onChange={(e) => setDepartureDate(e.target.value)}
                />
              </div>
              <div className="col-md-6">
                <label className="form-label">Departure Time</label>
                <input
                  type="time"
                  className="form-control"
                  value={departureTime}
                  onChange={(e) => setDepartureTime(e.target.value)}
                />
              </div>
            </div>

            {/* Airline Selection */}
            <div className="mb-4">
              <label className="form-label">Airline</label>
              <select className="form-select" value={airline} onChange={(e) => setAirline(e.target.value)}>
                <option value="">Select Airline</option>
                <option value="American Airlines">American Airlines</option>
                <option value="Delta Airlines">Delta Airlines</option>
                <option value="United Airlines">United Airlines</option>
                <option value="Southwest Airlines">Southwest Airlines</option>
                {/* Add more airlines as necessary */}
              </select>
            </div>

            {/* Optional: Weather Condition at Departure Airport */}
            <div className="mb-3">
              <label className="form-label">Weather Condition (Departure)</label>
              <select className="form-select" value={weatherCondition} onChange={(e) => setWeatherCondition(e.target.value)}>
                <option value="">Select Condition</option>
                <option value="Clear">Clear</option>
                <option value="Rainy">Rainy</option>
                <option value="Snowy">Snowy</option>
                <option value="Foggy">Foggy</option>
                <option value="Stormy">Stormy</option>
              </select>
            </div>

            <button type="submit" className="btn btn-primary w-100 mt-4">Predict Delay</button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default PredictorForm;
